import React from 'react';
import City from './City.js';
import data from '../assets/json/data.js';

class SecondContent extends React.Component {

    createTable() {
        var table = [];

        for (let i = 0; i < 4; i++) {
            const city = this.getRandomCity();
            if(!city.used) {
                console.log(city.name);
                city.used = true;
                table.push(
                    <li key={i}>
                        <City src={city.image} name={city.name} />
                    </li>
                );
            }
        }

        return table;
    }

    getRandomCity() {
        return data[Math.floor(Math.random() * data.length)];
    }

    render() {
        return (
            <div className="content2">
                <h5 className="city_header">Popular MYtineraries</h5>
                <ul className="cities">
                    {this.createTable()}
                </ul>
            </div>
        );
    }
}

export default SecondContent;
